import './App.css';

import MyHeader from './MyHeader'
function App() {

  let name : "Tom";

  return (
    <div className="App">
      <MyHeader />
      <header className="App-header">
        <h2>안녕 react (name)</h2>
      </header>
    </div>
  );
}

export default App;
